INSERT INTO incidentactions (id, details, date_of_entry) VALUES (1, 'The guard was repremanded and strongly warned.', '2007-12-06 19:53:27');
INSERT INTO incidentactions (id, details, date_of_entry) VALUES (2, 'All guards on duty that day were sacked.', '2007-12-07 10:22:28');
INSERT INTO incidentactions (id, details, date_of_entry) VALUES (3, 'THere were bullies every were. So we requested cabinent intervention.', '2007-12-07 10:26:54');
